import React, { Component } from "react";
import "../css/header.css";
import { Button } from "@material-ui/core";

export class Header extends Component {
  render() {
    return (
      <div className="header">
        <a href=".">
          <img
            src="https://geeksjapan.asia/assets/img/logo.png"
            alt="Logo"
            width="120px"
          />
        </a>
        <Link to="/:life">
          <Button color="secondary">Life</Button>
        </Link>
        <Button color="secondary">Explore</Button>
        <Button color="secondary">Work</Button>
        <Button color="secondary">Culture</Button>
        <Button color="secondary">Learn</Button>
      </div>
    );
  }
}

export default Header;
